    $scope.times = [{
      "val": -1,
      "text": "Disabled"
    }];

    $scope.link = {
      "link_generated": "",
      "link_voluum": "",
      "link_safe": "",
      "tags": [],
      "total_hits": 0,
      "real_hits": 0,
      "network": "",
      "angle": "",
      "use_ip_blacklist": true,
      "criteria": [
        { "country": "US", "region": "", "city": "" },
      ],
      "criteria_disallow": [],
      "auto_blacklist_count": 0,
      "payout": 36
    };

    $scope.query = {};
    $scope.showSafe = true;

    $scope.title = "Create A New Link";
    $scope.submitButtonTitle = "Create";
    $scope.countries = GeolocationCodes.getCountries();
